import ArticlesItem from "./Items/ArticlesItem";

const Articles = (props) => {
  return (
    <div>
      {props.data.map((el) => {
        return <ArticlesItem data={el} index={props.index} />;
      })}
    </div>
  );
};

export default Articles;
